import gql from "graphql-tag";

export const GET_SPACE_MSSION = gql`
  query GetSpaceMission($limit: Int!) {
    launchesPast(limit: $limit) {
      id
      mission_name
      launch_site {
        site_name_long
      }
      rocket {
        rocket_name
      }
      ships {
        image
      }
    }
  }
`;
